import React from 'react';
import './Footer.scss';
import { Logo } from '../Logo';

export const Footer = () => (
  <div className="Footer">
    <Logo />
    <div className="Footer-Socials">
      <a className="Footer-GitHub" href="https://github.com/kshvetsova">GITHUB</a>
      <a className="Footer-Contacts" href="tel:+3 8050 651-6468">CONTACTS</a>
      <a className="Footer-Rights" href="https://github.com/kshvetsova">RIGHTS</a>

    </div>

  </div>

);
